import Texto from '../components/texto'
import Menu from '../components/menu'

const teste = () => {

    var totalContador = 0

    function contador() {

        console.log('!')

    }

    var mensagem = "Olá mundo!"


    return (
        <div>

            <Menu />

            {mensagem}
            <br />
            <Texto titulo="Testando título">Texto aqui!!</Texto>
            <br />
            
            {totalContador}

            <input type="button" value="Conta" onClick={() => contador()} />
        </div>
    )    

}


export default teste
